import React from "react";
import "./App.css";
import GeneralRequirements from "./Components/GeneralRequirements.tsx";
import Concentrations from "./Components/Concentrations.tsx";

const App = () => {
  return (
    <>
      <div>
        <GeneralRequirements courseName={"MSE 45"} id={"mse45"} />
        <GeneralRequirements courseName={"MECHE C85"} id={"mechec85"} />
        <GeneralRequirements courseName={"BioE 10"} id={"bioe10"} />
        <GeneralRequirements courseName={"BioE 11"} id={"bioe11"} />
        <GeneralRequirements courseName={"Chem 3A"} id={"chem3a"} />
        <GeneralRequirements courseName={"CS 70"} id={"cs70"} />
        <GeneralRequirements courseName={"E7"} id={"e7"} />
        <GeneralRequirements courseName={"CS 61A"} id={"cs61a"} />
        <GeneralRequirements courseName={"CS 61B"} id={"cs61b"} />
        <GeneralRequirements courseName={"Physics 7A"} id={"physics7a"} />
        <GeneralRequirements courseName={"Physics 7B"} id={"physics7b"} />
        <GeneralRequirements courseName={"Math 55"} id={"math55"} />
        <GeneralRequirements courseName={"Math 54"} id={"math54"} />
        <GeneralRequirements courseName={"Math 53"} id={"math53"} />
        <GeneralRequirements courseName={"EECS 16A"} id={"eecs16a"} />
        <GeneralRequirements courseName={"EECS 16B"} id={"eecs16b"} />
      </div>
      <div className="sub-container">
        <Concentrations
          concentrationName={"Synthetic and Computational Biology"}
          id={"synthetic"}
        />
        <Concentrations
          concentrationName={"Cell & Tissue Engineering"}
          id={"cell"}
        />
        <Concentrations concentrationName={"Devices"} id={"devices"} />
        <Concentrations concentrationName={"Imaging"} id={"imaging"} />
      </div>
    </>
  );
};

export default App;
